    false,nt"url": null,nt"notes": "The hydrology dataset for Lincoln County,
    Oregon includes proposed 10-, 50-, 100-, and 500-year discharges for Salmon River,
    Schooner Creek, Drift Creek, Siletz River, Olalla Creek, West Olalla Creek, Alsea
    River, Yachats River, Yaquina River, Depot Creek, and Big Creek. Proposed discharges
    were determined using a log-Pearson Type III, flood frequency analysis of USGS gages
    with the computer program HEC-FFA, and regional regression equations.",nt"license_title":
